import Wheader from "./Wmenu"
import Wmenu from "./Wmenu"
import W1 from "./W1";
import W2 from "./W2";
import { Route , Routes} from "react-router-dom";

const Wmain = () => {

    return (
        <>
        <Wmenu />
        
        <Routes>
        <Route path="/" element={<Wmenu/>} />
        <Route path="/p1/:item" element={<W1/>}/>
        <Route path="/p2" element={<W2/>}/>
        </Routes>
        </>
    );
    
    }
    export default Wmain;
